app.controller("timelineController", function ($scope, $cordovaCamera, APIService, 
											   $ionicScrollDelegate, $ionicPopup, $interval,
											   $ionicModal){
	$scope.bug = {};
	$scope.bugs = [];
	$scope.postando=false;
	$scope.nenhumBug=false;
	$scope.verificarNovosBugs=false;
	$scope.quantidadeNovosBugs = 0;

	$scope.userID = localStorage.getItem("userID");
	$scope.name = localStorage.getItem("name");

	$ionicModal.fromTemplateUrl('comentarios.html', {
	    scope: $scope,
	    animation: 'slide-in-up'
	}).then(function(modal) {
	    $scope.modal = modal;
	});

	$scope.$watch('bugComentarios.comentarios.length', function (){
		if($scope.bugComentarios && $scope.bugComentarios.comentarios.length){
			$ionicScrollDelegate.$getByHandle('comentariosScroll').scrollBottom(true);
		}
	});

	$scope.comentarios = function (item){
		$scope.bugComentarios = item;
		$scope.bugComentarios.novoComentario = {};
		$scope.modal.show();
	}

	$scope.fecharComentarios = function (){
		$scope.modal.hide();
	}

	$scope.enviarComentario = function (){
		$scope.bugComentarios.novoComentario.data = moment().format("YYYYMMDDHHmmss");
		$scope.bugComentarios.novoComentario.userID = $scope.userID;
		$scope.bugComentarios.novoComentario.name = $scope.name;
		$scope.bugComentarios.comentarios.push(angular.copy($scope.bugComentarios.novoComentario));
		APIService.postarComentario($scope.bugComentarios).success(function (){
			$scope.bugComentarios.novoComentario = {};
		});
	}

	$interval(function (){
		
		if($scope.verificarNovosBugs){
			var ultimo = $scope.bugs.length ? $scope.bugs[0].data : 0;
			APIService.novosBugs(ultimo).success(function (res){
				$scope.quantidadeNovosBugs = res;
			});
		}

	}, 1000);

	var options = {};
	document.addEventListener("deviceready", function () {
		options = {
	      quality: 90,
	      destinationType: Camera.DestinationType.DATA_URL,
	      sourceType: Camera.PictureSourceType.CAMERA,
	      allowEdit: true,
	      encodingType: Camera.EncodingType.JPEG,
	      targetWidth: 600,
	      targetHeight: 700,
	      saveToPhotoAlbum: false,
		  correctOrientation:true
	    };
	}, false);

	$scope.listarTodosBugs = function (){
		APIService.obterTodosBugs().success(function (res){
			$scope.bugs = res;
			 $ionicScrollDelegate.scrollTop(true);
			if(!$scope.bugs.length){
				$scope.nenhumBug=true;
			} else {
				$scope.nenhumBug=false;
			}

			$scope.verificarNovosBugs=true;

		});
	}

	$scope.listarTodosBugs();

	$scope.novoBug = function (){
		
		$scope.bug.kkk = 0;
		$scope.bug.putz = 0;
		$scope.bug.comentarios = [];
		$scope.bug.userID = $scope.userID;
		$scope.bug.name = $scope.name;

		$cordovaCamera.getPicture(options).then(function(imageData) {
			$scope.verificarNovosBugs=false;
	      	if (typeof Camera !== 'undefined') {
			    $scope.bug.foto = "data:image/jpeg;base64," + imageData;
			} else {
		      	$scope.bug.foto = "data:image/jpeg;base64,";
		    }
		    $scope.bugs.length=0;
	    });

	}

	$scope.getPictureFacebook = function (userID){
		return "https://graph.facebook.com/"+userID+"/picture";
	}

	$scope.cancelarCadastro = function (){
		$scope.bug = {};
		$scope.listarTodosBugs();
	}

	$scope.postarBug = function (){
		if($scope.bug.descricao){
			$scope.postando=true;
			APIService.postarBug($scope.bug).success(function (res){
				$scope.postando=false;
				$scope.bug = {};
				$scope.listarTodosBugs();
			});
		} else {
			$ionicPopup.alert({
				title: 'No seja tmido  :)',
				template: 'Faa um comentrio sobre este bug!'
			});
		}
	}

	$scope.converterData = function (data){
		return moment(data, "YYYYMMDDHHmmss").fromNow();
	}

	$scope.kkk = function (item){
		item.kkk++;
		APIService.kkk(item.data);
	}

	$scope.putz = function (item){
		item.putz++;
		APIService.putz(item.data);
	}

	$interval(function (){
		APIService.obterInteracoes().success(function (res){
			for(i in $scope.bugs){
				for(x in res){
					if($scope.bugs[i].data == res[x].data) {
						$scope.bugs[i].kkk = res[x].kkk;
						$scope.bugs[i].putz = res[x].putz;
						$scope.bugs[i].comentarios = res[x].comentarios;
					}
				}
			}
		});	
	}, 5000);

});